const { genesis } = Block;

console.log(genesis.toString());

const block = new Block(Date.now(), genesis.hash, 'o6y', 'd4t4');
console.log(block.toString());

const block2 = new Block(Date.now(), block.hash, 'h4sh-block2', 'd4t4-2');
console.log(block2.toString());

